export const TriIcon = ({
  lightTrigger,
  hiddenBg,
}: {
  lightTrigger: boolean;
  hiddenBg?: boolean;
}) => {
  return lightTrigger ? (
    <TriIconLight hiddenBg={hiddenBg} />
  ) : (
    <TriIconDark hiddenBg={hiddenBg} />
  );
};

